import { useState } from "react";
function App() {
  let [fav, myFav] = useState({
    name: "Rafi",
    fatherName: "jawid",
  });
  let handler = ({...fav}) => {
    myFav();
  };
  return (
    <>
      <button onClick={handler}>click</button>
    </>
  );
}

export default App;
